lass GroceryItem:
    def __init__(self, name, quantity, price):
        self.name = name
        self.quantity = quantity
        self.price = price

    def __str__(self):
        return f"Grocery Item: {self.name} (Quantity: {self.quantity}, Price: {self.price})"

    def __round__(self):
        """Rounds the quantity and price to the nearest integers."""
        return round(self.quantity), round(self.price)

    def __eq__(self, other_item):
        """Returns True if this grocery item's rounded quantity and price
        match the other item's rounded quantity and price."""
        return round(self) == round(other_item)

